import React from 'react';
import { Link } from 'react-router-dom';
import { Navbar, Nav } from 'react-bootstrap';

const NavBar = () => {
  return (
    <div className="NavBar">
      <ul className="col-sm-4">
        <li><span className="NavBarItems">Home</span></li>
        <li><span className="NavBarItems">News</span></li>
        <li><span className="NavBarItems">Contact</span></li>
        <li><span className="NavBarItems">About</span></li>
        {/* <li><span className="NavBarItems">About</span></li>
        <li><span className="NavBarItems">About</span></li>
        <li><span className="NavBarItems">About</span></li>
        <li><span className="NavBarItems">About</span></li> */}
      </ul>
      <ul className="col-sm-4">
        <li><span className="NavBarItems">Home</span></li>
        <li><span className="NavBarItems">News</span></li>
        <li><span className="NavBarItems">Contact</span></li>
        <li><span className="NavBarItems">About</span></li>
        {/* <li><span className="NavBarItems">About</span></li>
        <li><span className="NavBarItems">About</span></li>
        <li><span className="NavBarItems">About</span></li>
        <li><span className="NavBarItems">About</span></li> */}
      </ul>
      <ul className="col-sm-4">
        <li><span className="NavBarItems">Home</span></li>
        <li><span className="NavBarItems">News</span></li>
        <li><span className="NavBarItems">Contact</span></li>
        <li><span className="NavBarItems">About</span></li>
        {/* <li><span className="NavBarItems">About</span></li>
        <li><span className="NavBarItems">About</span></li>
        <li><span className="NavBarItems">About</span></li>
        <li><span className="NavBarItems">About</span></li> */}
      </ul>
    </div>
  );
};

export default NavBar;
